@Ozair049  too early to tell! Many of these will have to show “path to profitability” OR demonstrate they can accelerate growth

For eg, $PAYTM.P has to demonstrate they can accelerate growth by entering new markets like insurance, lending, etc.

Easy answer to your question is the largest IPOs bc they’ll have media hype, most cash to spend, most US investment, and likely the most dominant players in really big markets
